script: |
  super -f text -I q1873.spq | sort > q1873.out

inputs:
  - name: q1873.spq
    data: |
      SELECT DISTINCT col1 + - col2 FROM tab2 (FORMAT parquet) WHERE ( NOT - col0 * + col2 + - - col2 + col2 >= - + col0 / 36 * 79 );
  - name: tab2

outputs:
  - name: q1873.out
    data: |
      28
      37
      9
